import React, { Component } from 'react'
import {Timeline, Events, ImageEvent} from '@merc/react-timeline';

export class TimelineElement extends Component {

  render() {
    const {data} = this.props;
    console.log("this is the data",{data})
    const result = Object.values(this.props);
    const result2 = result[0];
    console.log(result2)
    //const sortedArray = result2.sort((a, b) => b.result2.date - a.result2.date);
    console.log(sortedArray)
    const data2 =[{"name":"test1"},{"name":"test2"},{"name":"test3"},{"name":"test4"}];
    console.log(data2)
    const lists = data2.map((p) => <li key={p.name}>{p.name}</li>)

    return (
        <div id="timeline">
        <p> test
        {lists}
        </p>
        <Timeline>
          <Events>
          {result2 ? result2.map(d =>
            <ImageEvent
            date={d ? d.date : 'loading'}
            text={d ?d.text : 'loading'}
            src={d ?d.src : 'loading'}
            credit={d ?d.textBelow : 'loading'}
            />
          ): 'loading'}
           </Events>
         </Timeline>
   </div>
    )
  }
}

export default TimelineElement
